package services;import model.IntrareViewEntity;import model.RegistruAOUGEntity;import model.RegistruAOUGViewEntity;import model.repository.IntrareRepository;import model.repository.IntrareViewRepository;import model.repository.RegistruAOUGRepository;import model.repository.RegistruAOUGViewRepository;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import org.springframework.transaction.annotation.Transactional;import java.sql.Timestamp;import java.util.List;@Servicepublic class RegistruServiceImpl implements RegistruService {    @Autowired    private RegistruAOUGRepository registruAOUGRepository;    @Autowired    private RegistruAOUGViewRepository registruAOUGViewRepository;    @Autowired    private IntrareRepository intrareRepository;    @Autowired    private IntrareViewRepository intrareViewRepository;    @Override    @Transactional    public RegistruAOUGEntity save(RegistruAOUGEntity entity) {        entity.setCreatDe(UserUtils.getLoggedInUsername());        entity.setCreatLa(new Timestamp(System.currentTimeMillis()));       return registruAOUGRepository.save(entity);    }    @Override    public RegistruAOUGEntity update(RegistruAOUGEntity entity) {        return null;    }    @Override    @Transactional    public List<RegistruAOUGViewEntity> findAllAOUG() {        return (List<RegistruAOUGViewEntity>) registruAOUGViewRepository.findAll();    }    @Override    public List<IntrareViewEntity> findAllIntrari() {        return (List<IntrareViewEntity>) intrareViewRepository.findAll();    }}